import React from 'react'
import defaultImage from './logo.svg';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const Results = (props) => {

  
  const {path,output,closeModel,processimage}=props
  console.log(output)
  function createData(Item, Quantity, Cost) {
    return {Item, Quantity, Cost};
  }
  let map={};
  let names=[];
  let counter=[]
  output.forEach((item)=>{
    if(item ===2 )
    {
    if( map.has('Orange'))
    { 
      counter[2]++;
    }
    else
    {
      counter[2]++;
      names[2]="Orange";
    }
  }
    else if(item ===1 )
    {
    if( map.has('Banana'))
    { 
      counter[1]++;
    }
    else
    {
      counter[1]++;
      names[1]="Banana";
    }
  }
  else
  {
  if( map.has('Apple'))
  { 
    counter[0]++;
  }
  else
  {
    counter[0]++;
    names[0]="Apple";
  }
}
    })
    console.log(names)
    console.log(counter)
  const rows  =  output.map((item)=>{
    
    if (item===0)
    {
      return "Apple";
    }
    else if(item===1)
    {
      return "banana";
    }
    else
    {
      return "orange";
    }
  });
console.log(rows)


  function onclickfun(){
    
    processimage(defaultImage)
    closeModel(false);
  }
  return (
    <div>
      <img src={path}></img>
      <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Item</TableCell>
            <TableCell align="right">Quantity&nbsp;(g)</TableCell>
            <TableCell align="right">Cost&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.Item}
              </TableCell>
              <TableCell align="right">{row.Quantity}</TableCell>
              <TableCell align="right">{row.Cost}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
      <button onClick={onclickfun}></button>
    </div>
  );
};

export default Results;
